  const { title, link, img, price } = props;

  return (
      <Card>
      <Image src= {img} />
      <Card.Content>
        <Card.Header>{title}</Card.Header>
        <Card.href>{link}</Card.href>
        <Card.Description>{price}</Card.Description>
